import ReactDOM from 'react-dom';
import React, { Component } from 'react';
import './index.css';

class Statement extends Component{
	constructor(props){
		super(props);
		this.state = {date: new Date()};
	}

  componentDidMount() {
  	 this.timerID = setInterval(
      () => this.tick(),
      1000
    );
  }

  componentWillUnmount() {
  	clearInterval(this.timerID);
  }

  tick() {
    this.setState({
      date: new Date()
    });
  }

	render(){
		return (
		  <div>
		  <th> props.currentVersion</th>
		  <th> props.currentVersion</th>
		  <th>props.currentVersion</th>
		  <th>props.currentVersion</th>
		  <th>{this.state.date.toLocaleTimeString()}</th>
		  </div>
			);
		}
}

class StatementTable extends Component{
	constructor(props){
		super(props);
		// this.state = {statementList: [new Statement(), new Statement()]}
		// this.state = {statementList: ["john", "Jeff"]}
		this.state = {statementList: new Statement()}
	}


  componentDidMount() {
  	 this.timerID = setInterval(
      () => this.tick(),
      1000
    );
  }

	render() {
		return (
			<table>
			<tr>
			<Statement />
			</tr>
			</table>
			);
	}

}


ReactDOM.render(<StatementTable />, document.getElementById('root'));
